import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import PageHeader from './PageHeader';

function HomePage(){
    return(
        <React.Fragment>
        <PageHeader>
            Welcome
        </ PageHeader>
            <Container float-left>
                <Row>
                    <Col md={8}>
                        <h5 small>For someone with diabetes, there are two numbers that you must know:  your average glucose and your A1C.  
                        This site will help you keep track of both.</h5>
                    </Col>
                </Row>
            </Container>
        </React.Fragment>
    )
}

export default HomePage;
